import React, { Component } from "react"
import "./styles.css"
import "./face_expression_model-weights_manifest.json"
import "./tiny_face_detector_model-weights_manifest.json"

class VidContainer extends Component {
    render() {
        return (
        <div style={{position: "relative"}}>
      <video onLoadedMetadata="onPlay(this)" id="inputVideo" className="video-circle" width="500" height="500" autoPlay muted playsInline></video>
      <canvas id="overlay" />
    </div>
        )
    }
}

export default VidContainer
